  const [input, setInput] = useState('')

  let command = ''
  function handleInput(e) {
    command = e.target.value
  }


  return (
    <div class='App'>
      <History
       input={input}
      />
      <input onChange={handleInput}/>
      <button /*onClick={handleClick}*//>
    </div>
  )
}

function History(input) {

  const [history, setHistory] = useState('')


  setHistory({input})


  return (
    <ul>
      {history}
    </ul>
  )
}



export default App;
